import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import React, {useState} from 'react';

import ClubsDropdown from './components/ClubsDropdown';
import Wheel from './components/Wheel';

function App() {

  const [activeClubs, setActiveClubs] = useState(['Driver', 'Putter', 'Pitching'])

  const woodsAndHybrids = ['3 Wood', '5 Wood', '1 Hybrid', '2 Hybrid', '3 Hybrid', '4 Hybrid', '5 Hybrid'];
  const irons = ['1 Iron', '2 Iron', '3 Iron', '4 Iron', '5 Iron'];
  const wedges = ['Gap', 'Lob', 'Trouble'];

  return (
    <div className="App">
      <div className='clubDropdownsWrapperDiv'>
        <ClubsDropdown clubs={woodsAndHybrids} />
        <ClubsDropdown clubs={irons} />
        <ClubsDropdown clubs={wedges} />
      </div>
      <Wheel/>
    </div>
  );
};

export default App;
